import { useEffect, useState } from "react";
import "../meio/meio.css";

function Meio({ nomeArquivo }) {
  const [dados, setDados] = useState(null);
  const [abaSelecionada, setAbaSelecionada] = useState(null);
  const [metodoSelecionado, setMetodoSelecionado] = useState(null);
  const [linguagemSelecionada, setLinguagemSelecionada] = useState(null);
  const [expandidos, setExpandidos] = useState({});

  useEffect(() => {
    if (!nomeArquivo) return;

    fetch(`/dados/${nomeArquivo}.json`)
      .then((res) => {
        if (!res.ok) throw new Error("Arquivo não encontrado");
        return res.json();
      })
      .then((json) => {
        setDados(json);
        setAbaSelecionada(null);
        setMetodoSelecionado(null);
        setLinguagemSelecionada(null);
      })
      .catch(() => setDados({ erro: "Arquivo não encontrado ou inválido." }));
  }, [nomeArquivo]);

  const toggleExpandir = (campo) => {
    setExpandidos((prev) => ({ ...prev, [campo]: !prev[campo] }));
  };

  const coresMetodo = {
    GET: "botao-get",
    POST: "botao-post",
    PUT: "botao-put",
    DELETE: "botao-delete",
  };

  return (
    <div className="meio">
      <div className="window">
        {!dados ? (
          <p>Selecione um item.</p>
        ) : dados.erro ? (
          <p>{dados.erro}</p>
        ) : (
          <div>
            {/* Botões */}
            <div className="area-botoes">
              {dados.botoes?.map((botao, index) => (
                <button key={index} className="botao">
                  {botao}
                </button>
              ))}
            </div>

            {/* Abas */}
            <div className="area-abas">
              {Object.keys(dados.abas).map((aba, index) => (
                <button
                  key={index}
                  className={`aba ${abaSelecionada === aba ? "ativa" : ""}`}
                  onClick={() => {
                    setAbaSelecionada(aba);
                    setMetodoSelecionado(null);
                    setLinguagemSelecionada(null);
                  }}
                >
                  {aba}
                </button>
              ))}
            </div>

            {/* Conteúdo da Aba */}
            {abaSelecionada && (
              <div className="conteudo-aba">
                <div className="campos">
                  <h3>Campos</h3>
                  {dados.abas[abaSelecionada].campos.map((campo, index) => (
                    <div key={index} className="campo">
                      <button onClick={() => toggleExpandir(campo.nome)}>
                        {campo.nome}
                      </button>
                      {expandidos[campo.nome] && (
                        <div className="descricao">{campo.descricao}</div>
                      )}
                    </div>
                  ))}
                </div>

                <div className="metodos">
                  <h3>Métodos</h3>
                  {dados.abas[abaSelecionada].metodos.map((metodo, index) => (
                    <div key={index} className="metodo-bloco">
                      <button
                        className={`metodo ${coresMetodo[metodo.metodo]}`}
                        onClick={() =>
                          setMetodoSelecionado(
                            metodoSelecionado === metodo ? null : metodo
                          )
                        }
                      >
                        {metodo.metodo}
                      </button>

                      {/* Tipos de código */}
                      {metodoSelecionado === metodo && (
                        <div className="linguagens">
                          {Object.keys(metodo.tipos_codigo).map((lang, i) => (
                            <button
                              key={i}
                              onClick={() =>
                                setLinguagemSelecionada(
                                  linguagemSelecionada === lang ? null : lang
                                )
                              }
                            >
                              {lang}
                            </button>
                          ))}
                        </div>
                      )}

                      {/* Código selecionado */}
                      {metodoSelecionado === metodo && linguagemSelecionada && (
                        <pre className="codigo">
                          {metodo.tipos_codigo[linguagemSelecionada]}
                        </pre>
                      )}
                    </div>
                  ))}
                </div>
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
}

export default Meio;
